import React from 'react';
import { ContainerNav } from '../styles/styles-bartop';
import LogoUser from '../../assets/img/logo_user.png'
import { facebook, instagram } from '../../config/redes';


const UserBartop = (props) => {



    return (
        <ContainerNav>

            <section>
                <img src={LogoUser} alt="popadvise"/>
            </section>

            <section>
                <p>www.popadvise.com</p>
            </section>

            <section>
                <a href={facebook} target="_blank" rel="noopener noreferrer">
                    <i className="fab fa-facebook-square"></i></a>

                <a href={instagram} target="_blank" rel="noopener noreferrer">
                    <i className="fab fa-instagram-square"></i></a>
            </section>

        </ContainerNav>
    );
};

export default UserBartop;
